const Item = ({item}) => {

    const elements = item[Object.keys(item)[0]];
  return (
      <div>
          {elements.map(el => {
              <div>{el.id} - {el.name} - {el.price}<br /></div>
          })}

      </div>
  );
}

export default Item;
